import React from 'react';
import './Navbar.css';



function Navbar(){
    return (
        <aside>
            <nav>
                <ul>
                    <li><a>New Thread</a></li>
                <li><a>Home</a></li>
                <li><a>Discover</a></li>
                <li><a>Library</a></li>
                <li><a>Login</a></li>
                <li><a>Signup</a></li>
            </ul>   
            </nav>
        </aside>
    );
}

export default Navbar;
